import './App.css';

function NavBar(){
  const logo = "Youness React Site"
  return(
    <nav>
      <span> { logo }</span>
      <ul>
        <li>Home</li>
        <li>Gallery</li>
        <li>Store</li>
        <li>Contact</li>
        <li>Location</li>
      </ul>
    </nav>
  )
}


export default NavBar ;
